// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";


contract NFT is ERC721,ERC721URIStorage{
    uint256 public totalNFT=0;
    uint256 public TOTAL_LAND=2000; //hard coded value
    address adminNft;
    event e1();
    event e2();
    event e3();
    event e4();
    event tokenCreated(bytes32,string);
    mapping(address=> uint256[]) public boostsOfUser;
    mapping(address=>uint256) public landOfUser;
    address[] public allUsers;
    string salt;

    constructor() ERC721("ProperT","PRT"){
        adminNft = msg.sender;
    }

    function mint(uint256 x, uint256 y,string memory cost, string memory hashG, string memory _tokenURI) public {
        // string memory salt= getSalt();
        totalNFT+=1;
        bytes memory  info = bytes(abi.encodePacked(cost,salt));
        // emit e1();
        bytes32 expectedHash = ripemd160(info);
        // emit e2();
        _mint(msg.sender, totalNFT);
        emit e3();
        _setTokenURI(totalNFT,_tokenURI);
        emit e4();
        //emit tokenCreated(expectedHash,hashG);
    }

    function _burn(uint256 tokenId) internal override(ERC721URIStorage, ERC721) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721URIStorage,ERC721)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function getTotalSupply() public view returns(uint256){
        return totalNFT;
    }

    function updateTokenURI(uint256 tokenId, string memory _newURI) public{
        require(msg.sender==ownerOf(tokenId),"You are not the owner of the token");
        _setTokenURI(tokenId, _newURI);
    }

    // function getSalt() private view returns(string memory){
    //     require(msg.sender == adminNft);
    //     return salt;
    // }
    // function verifyHash(string memory info) private view returns(bool){
    function ripe(bytes memory data) private view returns(bytes32){
        return ripemd160(data);
    } 
    // }
}
